CREATE TABLE IF NOT EXISTS ghg_emission_factor
(
    id bigserial NOT NULL PRIMARY KEY,
    pollutant_code character varying(12) NOT NULL,
    numerator_uom_code character varying(20) NOT NULL,
    denominator_uom_code character varying(20) NOT NULL,
    calculation_material_code character varying(20) NOT NULL,
    calculation_parameter_type_code character varying(20) NOT NULL,
    formula_indicator boolean NOT NULL,
    emission_factor numeric(30, 20),
    emission_factor_formula character varying(200),
    control_indicator boolean NOT NULL,
    description character varying(2000),
    note character varying(2000),
    source character varying(100),
    last_update_date date NOT NULL,
    control_measure_code character varying(20) NOT NULL,
    revoked boolean NOT NULL DEFAULT false,
    control_measure_code_2 character varying(20) NOT NULL DEFAULT '0',
    control_measure_code_3 character varying(20) NOT NULL DEFAULT '0',
    control_measure_code_4 character varying(20) NOT NULL DEFAULT '0',
    control_measure_code_5 character varying(20) NOT NULL DEFAULT '0',
    quality character varying(10),
    revoked_date date,
    min_value numeric,
    max_value numeric,
    applicability character varying(2000),
    derivation character varying(2000),
    date_updated date,
    condition character varying(20),

    CONSTRAINT ef_calc_material_fkey FOREIGN KEY (calculation_material_code)
        REFERENCES calculation_material_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_calc_parameter_fkey FOREIGN KEY (calculation_parameter_type_code)
        REFERENCES calculation_parameter_type_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_control_measure_fkey FOREIGN KEY (control_measure_code)
        REFERENCES control_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_control_measure_2_fkey FOREIGN KEY (control_measure_code_2)
        REFERENCES control_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_control_measure_3_fkey FOREIGN KEY (control_measure_code_3)
        REFERENCES control_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_control_measure_4_fkey FOREIGN KEY (control_measure_code_4)
        REFERENCES control_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_control_measure_5_fkey FOREIGN KEY (control_measure_code_5)
        REFERENCES control_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_numerator_uom_fkey FOREIGN KEY (numerator_uom_code)
        REFERENCES unit_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION,
    CONSTRAINT ef_denominator_uom_fkey FOREIGN KEY (denominator_uom_code)
        REFERENCES unit_measure_code (code) MATCH SIMPLE
        ON UPDATE NO ACTION
        ON DELETE NO ACTION
    );

CREATE INDEX IF NOT EXISTS i_pollutant_control
    ON ghg_emission_factor (pollutant_code, control_indicator);

